import React, { useState, useEffect } from 'react';
import { ReactSVG } from 'react-svg';
import styled, { keyframes } from 'styled-components';
import sparkle from '../images/sparkle.svg'; // Import your SVG

// Utility function to generate random numbers
const random = (min, max) => Math.floor(Math.random() * (max - min + 1)) + min;

// Utility function to pick a random color from a predefined list
const colorList = [
  '#ff7f50', '#3fc53e', '#b24bf3', '#3493ee', '#f04877',
  '#6e57c9', '#ea2f86', '#ffcc00', '#f09c0a', '#fae000',
  '#4070d3', '#493c9e',
];
const generateVibrantColor = () => colorList[random(0, colorList.length - 1)];

// Generate sparkle properties
const generateSparkle = () => ({
  id: String(random(10000, 99999)),
  createdAt: Date.now(),
  color: generateVibrantColor(),
  size: random(10, 20),
  zIndex: random(0, 1), // Randomly decide whether the sparkle should appear in front or behind
  style: {
    top: `${random(-10, 80)}%`, // Adjust the range to position higher or lower
    left: `${random(0, 100)}%`,
  },
});

// Custom hook for reduced motion preference
const usePrefersReducedMotion = () => {
  const [prefersReducedMotion, setPrefersReducedMotion] = useState(false);

  useEffect(() => {
    const mediaQuery = window.matchMedia('(prefers-reduced-motion: reduce)');
    const handleChange = () => setPrefersReducedMotion(mediaQuery.matches);

    mediaQuery.addEventListener('change', handleChange);
    setPrefersReducedMotion(mediaQuery.matches);

    return () => mediaQuery.removeEventListener('change', handleChange);
  }, []);

  return prefersReducedMotion;
};

// Custom hook for random intervals
const useRandomInterval = (callback, minDelay, maxDelay) => {
  const timeoutId = React.useRef(null);

  const runInterval = () => {
    const timeout = random(minDelay, maxDelay);
    timeoutId.current = setTimeout(() => {
      callback();
      runInterval();
    }, timeout);
  };

  useEffect(() => {
    if (minDelay === null || maxDelay === null) return;

    runInterval();
    return () => clearTimeout(timeoutId.current);
  }, [minDelay, maxDelay, callback]);
};

// Sparkles Component
const Sparkles = ({ children }) => {
  const [sparkles, setSparkles] = useState(() =>
    Array.from({ length: 3 }).map(() => generateSparkle())
  );
  const prefersReducedMotion = usePrefersReducedMotion();

  useRandomInterval(
    () => {
      const sparkle = generateSparkle();
      const now = Date.now();
      const nextSparkles = sparkles.filter((sp) => now - sp.createdAt < 750);

      nextSparkles.push(sparkle);
      setSparkles(nextSparkles);
    },
    prefersReducedMotion ? null : 50,
    prefersReducedMotion ? null : 450
  );

  return (
    <Container>
      <SparkleContainer>
        {sparkles.map((sparkle) => (
          <Sparkle
            key={sparkle.id}
            color={sparkle.color}
            size={sparkle.size}
            zIndex={sparkle.zIndex}
            style={sparkle.style}
          />
        ))}
      </SparkleContainer>
      <TextWrapper>{children}</TextWrapper>
    </Container>
  );
};

// Individual Sparkle Component
const Sparkle = ({ size, color, zIndex, style }) => (
  <SparkleWrapper style={{ ...style, zIndex }}>
    <Svg
      src={sparkle}
      beforeInjection={(svg) => {
        svg.setAttribute('width', size);
        svg.setAttribute('height', size);
        svg.querySelector('path').setAttribute('fill', color);
      }}
    />
  </SparkleWrapper>
);

// Keyframe animations
const growAndShrink = keyframes`
  0% {
    transform: scale(0);
  }
  50% {
    transform: scale(1);
  }
  100% {
    transform: scale(0);
  }
`;

const spin = keyframes`
  0% {
    transform: rotate(-10deg);
  }
  100% {
    transform: rotate(10deg);
  }
`;

// Styled Components
const Container = styled.span`
  position: relative;
  display: inline-block;
`;

const SparkleContainer = styled.div`
  position: absolute;
  top: -10px; /* Move sparkles higher relative to the text */
  left: 0;
  width: 100%;
  height: 100%;
  pointer-events: none;
`;

const SparkleWrapper = styled.div`
  position: absolute;
  pointer-events: none;
  animation: ${growAndShrink} 1200ms ease-in-out forwards;
`;

const Svg = styled(ReactSVG)`
  animation: ${spin} 1200ms linear forwards;
`;

const TextWrapper = styled.span`
  position: relative;
  z-index: 1; /* Ensure text sometimes overlaps sparkles */
`;

export default Sparkles;
